John Barba é músico solo no formato violão e voz, professor de música e integrante da banda Applause. Participou de projetos como ""Kilânio - Orquestra de Violões "", ""Orquestra Latino Americana da Unespar"" além de diversas apresentações por bares e eventos no PR e SC.

Michelle Felix é professora de música e integrante do Grupetto Emuná, onde participa como violinista em diversos eventos. Participou da orquestra Filarmônica da UFPR e atuou por 10 anos como professora dos cursos extra curriculares do Colégio Dom Bosco.

Vanessa Kühn é musicista e professora de música formada em Licenciatura em Música pela EMBAP (atual Unespar) em 2004. Fez vários cursos de educação musical, participou de seminários e Festivais de Música. Cursou a formação musical em piano e avançado em Piano pela EMBAP, o curso de composição e regência de 2005 a 2009. Pós graduada em Educação Especial em 2007 e Neuropsicopedagogia Clinica em 2019. Atualmente estuda violino com a violinista Bettina Jucksch.

